import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Navegar = () => {
  const navigate = useNavigate();
  const [talleres, setTalleres] = useState([]);
  const [categorias, setCategorias] = useState([]);
  const [filtro, setFiltro] = useState("");
  const [cargando, setCargando] = useState(true);

  // Simulación de llamada a API Flask
  useEffect(() => {
    const fetchTalleres = async () => {
      try {
        // Reemplazar con llamada real a tu API
        const response = await fetch("http://localhost:5000/api/talleres");
        const data = await response.json();
        
        setTalleres(data.talleres);
        setCategorias([...new Set(data.talleres.map(t => t.categoria))]);
        setCargando(false);
      } catch (error) {
        console.error("Error fetching data:", error);
        setCargando(false);
      }
    };

    fetchTalleres();
  }, []);

  const handleNavigation = (path) => navigate(path);

  const talleresFiltrados = filtro 
    ? talleres.filter(taller => taller.categoria === filtro)
    : talleres;

  // Estilos (se mantienen igual que en tu código)
  const styles = { /* ... tus estilos actuales ... */ };

  return (
    <div style={styles.mainContainer}>
      {/* Menú superior (se mantiene igual) */}
      <nav style={styles.nav}>{/* ... */}</nav>

      <div style={styles.contentContainer}>
        <div style={styles.mainCard}>
          <h1 style={styles.title}>TALLERES DISPONIBLES</h1>
          
          {/* Selector de categoría (NUEVO) */}
          <div style={{ marginBottom: "25px" }}>
            <select 
              value={filtro}
              onChange={(e) => setFiltro(e.target.value)}
              style={{
                padding: "10px",
                borderRadius: "8px",
                border: "1px solid #6B8E23",
                backgroundColor: "#FAFAFA"
              }}
            >
              <option value="">Todas las categorías</option>
              {categorias.map((cat, index) => (
                <option key={index} value={cat}>{cat}</option>
              ))}
            </select>
          </div>

          {cargando ? (
            <p>Cargando talleres...</p>
          ) : talleresFiltrados.length === 0 ? (
            <p style={{ textAlign: "center", color: "#666666" }}>
              {filtro 
                ? `No hay talleres disponibles en la categoría ${filtro}`
                : "Actualmente no hay talleres disponibles"}
            </p>
          ) : (
            <div style={styles.gridContainer}>
              {talleresFiltrados.map((taller) => (
                <div key={taller.id} style={styles.tallerCard}>
                  <img src={taller.imagen} style={styles.tallerImage} alt={taller.nombre} />
                  <div>
                    <h2 style={styles.tallerName}>{taller.nombre}</h2>
                    <p style={styles.tallerDesc}>
                      <strong>Categoría:</strong> {taller.categoria}<br />
                      <strong>Fecha:</strong> {taller.fecha}<br />
                      <strong>Precio:</strong> ${taller.precio}<br />
                      <strong>Cupos:</strong> {taller.cupos_disponibles}/{taller.cupos_totales}
                    </p>
                  </div>
                  <button 
                    style={styles.infoButton}
                    onClick={() => navigate(`/detalle/${taller.id}`)}
                  >
                    + INFO
                  </button>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Navegar;
